INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Delivery', '', 'Our terms and conditions of delivery', 'conditions, delivery, delay, shipment, pack', '<h2>Shipments and returns </h2>\n<h3>Your pack shipment (NB)</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.<br /><br />NB NB NB</p>', 'delivery'),
(2, 1, 1, 'Legal Notice', '', 'Legal notice NB', 'notice, legal, credits', '<h2>Legal</h2>\n<h3>Credits</h3>\n<p>Concept and production:</p>\n<p>This Web site was created using <a href=\"http://www.prestashop.com\">PrestaShop</a>™ open-source software and NB developers.</p>', 'legal-notice'),
(3, 1, 1, 'Terms and conditions of use', '', 'Our terms and conditions of use', 'conditions, terms, use, sell', '<h2>Your terms and conditions of use</h2>\n<h3>Rule 1</h3>\n<p>Here is the rule 1 - there are no rules (NB)</p>', 'terms-and-conditions-of-use'),
(4, 1, 1, 'About us', '', 'Learn more about us (NB)', 'about us, informations', '<h2>About us</h2>\n<h3>Our company</h3>\n<p>MMM</p>\n<h3>Our team</h3>\n<p>Krzysztof, Jakub, Marcin, Kamil, Tim</p>\n<h3>Informations</h3>\n<p>Perfect Team 11/10 NB</p>', 'about-us'),
(5, 1, 1, 'Secure payment (NB)', '', 'Our secure payment mean', 'secure payment, ssl, visa, mastercard, paypal', '<h2>Secure payment (NB)</h2>\n<h3>Our secure payment</h3>\n<p>With SSL</p>\n<h3>Using Visa/Mastercard/Paypal (NB)</h3>\n<p>About this services</p>', 'secure-payment-nb');
